CREATE TABLE ZOO_EMPLOYEE(
   EMPLOY_ID          NUMBER(4,0) NOT NULL
  ,FIRST_NAME         VARCHAR(10) NOT NULL
  ,LAST_NAME          VARCHAR(13) NOT NULL
  ,EMAIL              VARCHAR(33) NOT NULL
  ,SSN                VARCHAR(11) NOT NULL
  ,VOLUNTEER          VARCHAR(1) NOT NULL
  ,STREET_ADDRESS     VARCHAR(28) NOT NULL
  ,CITY               VARCHAR(17) NOT NULL
  ,STATE              VARCHAR(20) NOT NULL
  ,ZIP                NUMBER(5,0) NOT NULL
  ,CONTRACTOR         NUMBER(4,0)
  ,DEPARTMENT         NUMBER(4,0) NOT NULL
  ,CONTRACTOR_Y_N     VARCHAR(1)
  ,ENCLOSURE_ASSIGNED VARCHAR(51)
  ,constraint employee_id_pk PRIMARY KEY (employee_id)
);
